script: |
  super -f text -I q12080.spq | sort > q12080.out

inputs:
  - name: q12080.spq
    data: |
      SELECT + + 61 / - col1 + - - ( - 50 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( + - ( + 93 ), ( + col0 ) * + - col1 );
  - name: tab2

outputs:
  - name: q12080.out
    data: |
      -50
      -50
      -51
